31s6qdUQ7kNvwEWrA4H&_nc_oc=AdkhKjZ9BVLGuuh79VD2o5_BoslRRu5vm7RFyCcCUt7KNywR5h8phqx0fskmBGzjmys&_nc_zt=23&_nc_ht=scontent-lga3-3.cdninstagram.com&_nc_gid=RMATmtYeOrTpzbCU9NYCdA&oh=00_Afij2xYCgNJ2I3PJXCTeRU9pATpCXloWB5C5GXtyY3lx1A&oe=69194676\",[9],[9],[9],[9],[9],[9],[19,\"0\"],\"Sasaki Kojiro\\u2019s sword was 3 feet long.\\nCalled it \\u201cThe Drying Pole.\\u201d\\nNever been defeated.\\n\\nMusashi showed up to fight him with a wooden oar.\\n\\nA. Wooden. Oar.\\n\\nBut that\\u2019s not the insane part.\\n\\nApril 13, 1612.\\nGanryu Island.\\n\\nKojiro arrived at dawn.\\nStretched.\\nPracticed his cuts.\\nThe perfect warrior.\\n\\nMusashi?\\n\\nHe was sitting in his boat.\\nEyes closed.\\nNot moving.\\nFor 3 hours.\\n\\nThe boatman kept asking: \\u201cMaster, we\\u2019re here.\\u201d\\n\\nSilence.\\n\\n\\u201cMaster, he\\u2019s waiting.\\u201d\\n\\nSilence.\\n\\n\\u201cMaster, the sun is high now.\\u201d\\n\\nFinally, Musashi opened his eyes.\\nPicked up an oar.\\nStarted carving.\\n\\nJust... carving a piece of wood.\\nWhile Japan\\u2019s deadliest swordsman waited.\\n\\nWhen Musashi finally stepped onto the beach, Kojiro was purple with rage.\\n\\n\\u201cYOU DARE SHOW UP LATE?\\u201d\\n\\u201cWITH A PIECE OF DRIFTWOOD?\\u201d\\n\\u201cAGAINST THE DRYING POLE?\\u201d\\n\\nMusashi said nothing.\\nJust kept walking forward.\\n\\nKojiro screamed and charged.\\n\\nOne strike.\\n\\nThe wooden oar cracked Kojiro\\u2019s skull.\\nHe died instantly.\\n\\nHere\\u2019s what those 3 hours were about:\\n\\nMusashi wasn\\u2019t late.\\nHe wasn\\u2019t carving.\\n\\nHe was killing Kojiro.\\nOver and over.\\nIn his mind.\\n\\nHe saw every possible attack.\\nEvery angle.\\nEvery response.\\n\\nBy the time his feet touched sand, he\\u2019d already won 1000 times.\\n\\nThe oar?\\n\\nLonger than the Drying Pole by 6 inches.\\nMusashi carved it to the exact length needed.\\n\\nWhile Kojiro spent 3 hours getting angry...\\nMusashi spent 3 hours becoming empty.\\n\\nNo anger.\\nNo fear.\\nNo thought.\\nJust the perfect counter to whatever would come.\\n\\nHe wrote later:\\n\\n\\u201cThe true Way of strategy is not in the sword.\\nIt\\u2019s in the void.\\nBecome nothing, and nothing can defeat you.\\u201d\\n\\nKojiro was the better swordsman.\\nBut he lost to a man who wasn\\u2019t even there.\\n\\nJust emptiness holding an oar.\\n\\nIf you\\u2019re serious, follow \\u0040lonewarriorwisdom \\n\\n#warrior #innerjourney #stoicism #warriormindset #lockedin #mindset\",[9],[9],[9],[9],[9],[9],[9],[9],[19,\"80\"]]],[1,[5,\"insertAttachmentItem\",\"ee.mid.$gABd2GRb9uSaggwSrmWaUb9ig8tad\",[19,\"0\"],[19,\"6603774596331814\"],[19,\"0\"],\"mid.$gABd2GRb9uSaggwSrmWaUb9ig8tad\",[9],[9],[9],[9],[9],[9],[9],[9],[9],[9],[9],[9],[9],[9],[9],[9],[9],[9],[9],[9],[9],[9],[9],[9],[9],[9],false,\"full\",[9],[9],[9],[9],[9],[9],[9],[9],[9],[9],[9],[9],[9],[9],[9],[9],[9],[9],[19,\"0\"],[9]]],[1,[5,\"setForwardScore\",[19,\"6603774596331814\"],\"mid.$gABd2GRb9uSaggwSrmWaUb9ig8tad\",[19,\"1762308088729\"],[9]]],[1,[5,\"setMessageDisplayedContentTypes\",[19,\"6603774596331814\"],\"mid.$gABd2GRb9uSaggwSrmWaUb9ig8tad\",[19,\"1762308088729\"],\"\",false,false]],[1,[4,1,1,[5,\"getFirstAvailableAttachmentCTAID\"]],[5,\"insertAttachmentCta\",[69,[2,1],[19,\"0\"]],\"ee.mid.$gABd2GRb9uSaggwSrmWaUb9ig8tad\",[19,\"0\"],[19,\"6603774596331814\"],[19,\"0\"],\"mid.$gABd2GRb9uSaggwSrmWaUb9ig8tad\",\"\",\"igd_web_post_share\",[9],\"https:\\\/\\\/www.instagram.com\\\/reel\\\/DQmf2BfCMBT\\\/?id=3757830990975254611_75430861914\",\"instagram:\\\/\\\/reels_share\\\/?shortcode=DQmf2BfCMBT\",[9],[9],false,[9],[19,\"3757830990975254611\"],[9]],[5,\"updateAttachmentItemCtaAtIndex\",\"ee.mid.$gABd2GRb9uSaggwSrmWaUb9ig8tad\",[19,\"0\"],[69,[2,1],[19,\"0\"]],\"attachment\",\"igd_web_post_share\",[19,\"0\"]],[5,\"updateAttachmentCtaAtIndexIgnoringAuthority\",[19,\"6603774596331814\"],\"mid.$gABd2GRb9uSaggwSrmWaUb9ig8tad\",\"ee.mid.$gABd2GRb9uSaggwSrmWaUb9ig8tad\",[69,[2,1],[19,\"0\"]],\"attachment\
